INSERT INTO Recipe (recipe_id, title, subtitle, servings, yield_unit, prep_min, cook_min, stnd_min, source, intro, directions) VALUES (1410, 'No-Bake Chocolate Cheesecake', NULL, 12, NULL, 30, 0, 120, 'Hershey Foods Corporation', NULL, replace('Prepare Crumb-Nut Crust (directions follow); set aside. Melt chocolate chips in top of double boiler over hot, not boiling, water, stirring until smooth. Combine cream cheese and sugar in large mixer bowl; add butter, beating until smooth. Blend in vanilla. Beat in melted chocolate all at once. Whip cream until stiff; fold into chocolate mixture.

Spoon into prepared crust; chill while preparing Peach Topping (directions follow). Spoon topping onto chocolate layer and chill thoroughly. Garnish with grated chocolate.

Crumb-Nut Crust (first 4 ingredients): If using almonds, toast in shallow baking pan at 350 degrees F. for 8 to 10 minutes, stirring frequently; cool. Chop nuts very finely in food processor or blender (you should have 1 cup). Combine nuts with wafer crumbs and confectioners'' sugar in medium bowl; drizzle with melted butter. Press onto bottom and 1 1/2 inches up side of 9-inch springform pan.

Note: You may substitute 1 3/4 cups graham cracker crumbs for the nuts and vanilla wafer crumbs.

Peach Topping (last 7 ingredients): sprinkle gelatine onto cold water in small glass dish; allow to stand a few minutes to soften. Add boiling water and stir until gelatine is dissolved. Whip cream and sugar until stiff; beat in gelatine mixture and vanilla. Fold in diced peaches.','
',char(10)));
INSERT INTO Recipe (recipe_id, title, subtitle, servings, yield_unit, prep_min, cook_min, stnd_min, source, intro, directions) VALUES (666, 'Saffron Risotto Primavera', NULL, 4, NULL, 20, 40, 0, 'USA Rice Council', 'A traditional Italian way to cook rice which results in a creamy side dish. Best served hot, as this dish doesn''t wait.', 'Cook mushrooms, zucchini, and red pepper until tender crisp in 1 teaspoon oil in large skillet over medium-high heat. Remove vegetables; set aside. Cook onions in remaining 1 teaspoon oil in same skillet until soft. Add rice and saffron; stir 2 to 3 minutes. Add wine and stir until absorbed. Stir in broth. Cook, uncovered, stirring frequently, until broth is absorbed. Continue stirring and add 2 cups water, allowing the first cup to be absorbed before adding the second. Cook until rice is tender and mixture has a creamy consistency. It will take approximately 25 to 30 minutes. Stir in cheese, parsley, white pepper, and reserved vegetables. Serve immediately.');
INSERT INTO Recipe (recipe_id, title, subtitle, servings, yield_unit, prep_min, cook_min, stnd_min, source, intro, directions) VALUES (1351, 'B.L.T. Salad', NULL, 6, NULL, 15, 0, 0, 'Monterey Mushrooms', 'A new twist to an old favorite. Serve with crackers or melba toast.', replace('Cut 18 center slices from tomatoes. Lightly salt. Arrange in 6 lettuce-lined salad bowls.
Coarsely chop tomato ends. Toss with mushrooms, bacon, onion, oil vinegar, salt and pepper. Spoon over tomato slices.','
',char(10)));

